
CREATE DATABASE controlacceso IF NOT EXISTS;


CREATE TABLE IF NOT EXISTS students (
    Matricula VARCHAR(80) PRIMARY KEY,
    NombreCompleto VARCHAR(60),
    Inclusion BOOLEAN,
    Generacion VARCHAR(20),
    Genero VARCHAR(15),
    Carrera VARCHAR(40),
    Cuatrimestre INT,
    Grupo VARCHAR(40),
    FolioDeCredencial VARCHAR(20),
    FolioDeCredencial2 VARCHAR(20),
    EstatusDeImpresion VARCHAR(20),
    ESTATUS BOOLEAN
);

